	var imgData = 'data:image/png;base64,';
function CreateBook() {
	var player = parent.GetPlayer();

	var doc = new jsPDF('p', 'pt', 'letter');

	var font = '';

	doc.addFileToVFS('Roboto-normal.ttf', font);
	doc.addFont('Roboto-normal.ttf', 'Roboto', 'normal');

	doc.setFont('Roboto', 'normal');

	doc.addImage(imgData, 'PNG', 0, 0, 612, 792);

	var TextEntry40 = player.GetVar("TextEntry40");
	TextEntry40 = doc.splitTextToSize(TextEntry40, 530);
	doc.text(32, 220, TextEntry40);

	
	// Save the PDF
	doc.save('Workbook.pdf');
}